export const useStyles = makeStyles((theme) => ({
  Ribbon: {
    background: 'blue',
    color: 'black',
    padding: '10px',
    position: 'absolute',
    color: ' #fff',
    fontSize: '16px',
    textAlign: 'center',
    right: 0,
  },
}))
